'''Orks''' are stocky, green-skinned humanoids. They have small tusks protruding from their jaws, and prefer to wield large axes and/or maces.

Orks can be found in the [[God Wars Dungeon]], in the army of [[Bandos]]. These Orks are notable as the most reliable soldiers in the army of Bandos, as they can hit up to 12 health points. While they are normally tolerant of players who wear Bandosian-affiliated items, if the player damages an ork and is either killed by them or another monster, all nearby orks will become aggressive towards the player.

Orks also appear at a certain point in [[A Fairy Tale Part 2]]. The [[Fairy Godfather]] is trying to replace the [[Fairy Queen]] and the [[Fairy|fairies]] with Orks. Some of these Orks have no shown level, and some are level 20, but neither type can be attacked. They can be talked to, but all they say is "Grunt! Smelly, stinky human! Urgh! Leave us alone before we hurt you."

